import { TokenList } from "../types";
// import schema from "@uniswap/token-lists/src/tokenlist.schema.json";
// import Ajv from "ajv";
import axios from "axios";

const oneInch = "https://api.1inch.exchange/v3.0/56/tokens";

export default function getTokenList() {
  return axios.request<{ ["tokens"]: TokenList }>({
    url: oneInch,
    transformResponse: (r: { ["tokens"]: TokenList }) => r.tokens,
  });
}
